import React from 'react';

function Profile() {
  function goBack() {
    navigate(-1, { replace: true });
  }

  return (
    <section className='profile'>
      <Logo />
      <h3 className='profile__title'>{title}</h3>
      <form
        className='auth__form'
        name={formName}
        noValidate
        autoComplete='off'>
        {children}
        <button
          className={`auth__button`}
          type='submit'>
          {buttonText}
        </button>
      </form>
      <button
        className='header__logout'
        onClick={goBack}>
        Выйти
      </button>
    </section>
  );
}

export default Profile;
